import "./Sidebar.css";
function Sidebar() {
  return (
    <div className="sidebar">
        <h1>Hello</h1>
        <div className="sidebar__header">
              <div className="sidebar__headerRight">
                </div>  
        </div>
    </div>
  )
}

export default Sidebar;
